-- Post-Load SQL T_META_TABLE_CFG
Prompt Post-Load SQL T_META_TABLE_CFG
prompt merge to T_META_TABLE_cfg

delete from DQ_USER.T_META_TABLE target
where not exists (select 1 from DQ_USER.T_META_TABLE_cfg cfg where target.schema_name = cfg.schema_name and target.table_name = cfg.table_name);

merge
 into
   DQ_USER.t_meta_table target
   using
     ( select   
             cfg.schema_name
            ,cfg.table_name
            ,cfg.technical_user
            ,cfg.category
            ,cfg.stats_refresh_min
            ,cfg.legal_entity_column
            ,cfg.partition_column
            ,cfg.active_indicator
            ,cfg.archive_config_id
            ,cfg.mock_table_name 
         from DQ_USER.t_meta_table_cfg cfg
         inner join DQ_USER.t_meta_table target
         on  target.schema_name = cfg.schema_name and target.table_name = cfg.table_name
         and (
            nvl(target.technical_user, '~') <> nvl(cfg.technical_user, '~') or
            nvl(target.category, '~') <> nvl(cfg.category, '~') or
            nvl(target.stats_refresh_min, -1) <> nvl(cfg.stats_refresh_min, -1) or
            nvl(target.legal_entity_column, '~') <> nvl(cfg.legal_entity_column, '~') or
            nvl(target.partition_column, '~') <> nvl(cfg.partition_column, '~') or
            nvl(target.active_indicator, '~') <> nvl(cfg.active_indicator, '~') or
            nvl(target.archive_config_id, -1) <> nvl(cfg.archive_config_id, -1) or
            nvl(target.mock_table_name, '~') <> nvl(cfg.mock_table_name, '~') 
              )
        union all
         select   
             cfg.schema_name
            ,cfg.table_name
            ,cfg.technical_user
            ,cfg.category
            ,cfg.stats_refresh_min
            ,cfg.legal_entity_column
            ,cfg.partition_column
            ,cfg.active_indicator
            ,cfg.archive_config_id
            ,cfg.mock_table_name 
         from DQ_USER.t_meta_table_cfg cfg
         where not exists (select 1 from DQ_USER.t_meta_table target where target.schema_name = cfg.schema_name and target.table_name = cfg.table_name )
         ) cfg
  on ( target.schema_name = cfg.schema_name and target.table_name = cfg.table_name)
  when matched 
  then 
    update set 
            target.technical_user = cfg.technical_user,
            target.category = cfg.category,
            target.stats_refresh_min = cfg.stats_refresh_min,
            target.legal_entity_column = cfg.legal_entity_column,
            target.partition_column = cfg.partition_column,
            target.active_indicator = cfg.active_indicator,
            target.archive_config_id = cfg.archive_config_id,
            target.mock_table_name = cfg.mock_table_name 
    when not matched then insert 
    (       target.schema_name
            ,target.table_name
            ,target.technical_user
            ,target.category
            ,target.stats_refresh_min
            ,target.legal_entity_column
            ,target.partition_column
            ,target.active_indicator
            ,target.archive_config_id
            ,target.mock_table_name 
      ) values 
 
         (
             cfg.schema_name
            ,cfg.table_name
            ,cfg.technical_user
            ,cfg.category
            ,cfg.stats_refresh_min
            ,cfg.legal_entity_column
            ,cfg.partition_column
            ,cfg.active_indicator
            ,cfg.archive_config_id
            ,cfg.mock_table_name 
         ); 
commit;

prompt updating the audit_table_id in DQ_USER.t_meta_table

merge
 into
   DQ_USER.t_meta_table target
   using
     ( select 
          tgt.table_name as target_table_name
        , tgt.table_id   as target_table_id
        , aud.table_name as audit_table_name
        , aud.table_id   as audit_table_id 
         from t_meta_table_cfg cfg
         join t_meta_table aud on aud.table_name = cfg.audit_table_name and aud.schema_name = 'DQ_USER'
         join t_meta_table tgt on tgt.table_name = cfg.table_name and tgt.schema_name = 'DQ_USER'
     ) cfg
  on ( target.table_id = cfg.target_table_id )
when matched then 
update set 
            target.audit_table_id = cfg.audit_table_id;

commit;            

